import React from 'react'
import { Modal, Button, Form, Col, Row, Accordion, ListGroup, useAccordionToggle } from 'react-bootstrap'

export default class Checklist extends React.Component {
  constructor(){
    super();
    this.state = {
        show: false
      }
    }

    render(){
      return(
        <div key={this.props.checklist.id}>
          <Accordion.Toggle eventkey={this.props.checklist.id}>
              {this.props.checklist.title}
          </Accordion.Toggle>
        <Accordion.Collapse eventkey={this.props.checklist.id}>
          <div>
            {this.props.checklist.items.map(item => {
              return(
                <ListGroup.Item key={item.id}>
                  <div className='float-left'>
                    {item.text}
                  </div>
                  <br />
                  <div className='float-right' onClick={console.log(item.id + ' ' + this.props.checklist.id)}>
                    {item.is_completed ? <i className="fa fa-fw fa-check" style={{ fontSize: '1.5em', color: 'silver'}} /> : <i className="fa fa-fw fa-green" style={{ fontSize: '1.5em', color: 'green'}} />}
                  </div>
                </ListGroup.Item>
              )
            })}
            </div>
          </Accordion.Collapse>
        </div>
      )
    }
}
